import Head from 'next/head';
import Layout from '../components/layout';

const Index = () => {
    return (
        <div>          
            <Head>
                <title>
                    Next.js Project - Home
                </title>
            </Head>
            <Layout>
                <h1>Hello index</h1>
            </Layout>
        </div>
        )
}

export default Index;
